import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './DisplayItem.css'; // Import a CSS file for styling

function DisplayItem() {
  const [inventoryItems, setInventoryItems] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
 
  useEffect(() => {
    loadInventory();
  }, []);

  const loadInventory = async () => {
    setIsLoading(true);
    try {
      const result = await axios.get("http://localhost:8080/inventory");
      console.log("API response data:", result.data); // Debug: Log the API response
      setInventoryItems(result.data);
      setError(null);
    } catch (error) {
      console.error("Error loading inventory:", error);
      setError("Failed to load inventory items. Please try again later.");
    } finally {
      setIsLoading(false);
    }
  };

  const updateNavigate = (id) => {
    navigate(`/updateitem/${id}`);
  };

  // Debug: Check the first item's structure if available
  useEffect(() => {
    if (inventoryItems && inventoryItems.length > 0) {
      console.log("First inventory item structure:", inventoryItems[0]);
    }
  }, [inventoryItems]);

  if (isLoading) {
    return <div className="loading">Loading inventory items...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  if (!inventoryItems || inventoryItems.length === 0) {
    return <div className="no-data">No inventory items found.</div>;
  }

  return (
    <div className="inventory-container">
      <h1>Inventory Items</h1>
      
      {/* Debug section to show raw data */}
      <div className="debug-section" style={{ margin: '20px 0', padding: '10px', border: '1px solid #ccc', borderRadius: '5px' }}>
        <h3>Debug Data (First Item):</h3>
        {inventoryItems.length > 0 && (
          <pre>{JSON.stringify(inventoryItems[0], null, 2)}</pre>
        )}
      </div>
      
      <table className="inventory-table">
        <thead>
          <tr>
            <th>Item ID</th>
            <th>Item</th>
            <th>Item Name</th>
            <th>Category</th>
            <th>Quantity</th>
            <th>Details</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {inventoryItems.map((item, index) => {
            return (
              <tr key={index}>
                <td>{item.itemId || 'N/A'}</td>
                <td className="image-cell">
                  {item.itemImage ? (
                    <img 
                      src={`http://localhost:8080/uploads/${item.itemImage}`} 
                      alt={item.itemName || 'Item image'}
                      className="inventory-image"
                      onError={(e) => {
                        e.target.onerror = null;
                        e.target.src = 'https://via.placeholder.com/100?text=No+Image';
                      }}
                    />
                  ) : (
                    <div className="no-image">No image</div>
                  )}
                </td>
                <td>{item.itemName || 'N/A'}</td>
                <td>{item.category || 'N/A'}</td>
                <td>{item.quantity || 'N/A'}</td>
                <td>{item.details || 'N/A'}</td>
                <td>
                  <button 
                    onClick={() => updateNavigate(item.id || item.itemId)} 
                    className="edit-button"
                  >
                    Update
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default DisplayItem;
